import React, { Component } from 'react';
import image1 from './Images/1.jpg';
import './Card.css';

class Card extends Component {
  populateDate(){
    console.log("HELLO WORLD");
  }

  render() {
    return (
      <div className="Card">
        <div class="card">
            <img class="card-img-top" src={image1} onClick={this.populateDate}/>
            <h5 class="card-title">Titanic: Machine Learning from Disaster</h5>
            <div class="card-block">
              <p class="card-text">Artificial neural network that predicts how likely a person is to survive on the titanic based on their background.</p>
            </div>
          </div>
      </div>
    );
  }
}

export default Card;
